	add("subset", "{\"term\":\"subset\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|sub|set|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"With respect to another set, a set such that each of its elements is also an element of the other set\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The set of integers is a subset of the set of reals\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The set {a, b} is a both a subset and a proper subset of {a, b, c} while the set {a, b, c} is a subset of {a, b, c} but not a proper subset of {a, b, c\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A group of things or people, all of which are in a specified larger group\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"We asked a subset of the population of the town for their opinion\", \"priority\":5}]}, \"synonyms\":{}}");

	add("subshell", "{\"term\":\"subshell\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|shell|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"atomic Atomic orbitals for which the values of the n and l quantum numbers are the same, such as the three 2p or five 3d atomic orbitals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A child process launched by a shell\", \"priority\":2}]}, \"synonyms\":{}}");

	add("subsidence", "{\"term\":\"subsidence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin {{lena}} \u0027subsidens\u0027 \u0027subsidentis\u0027 present participle of \u0027subsidere\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of becoming less active or sever\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bishop Warburto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The subdual or \u0027\u0027subsidence\u0027\u0027 of the more violent passions\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A sinking of something to a lower level, especially of part of the surface of the Earth due to underground excavation or seismic activity or groundwater depletion\", \"priority\":4}]}, \"synonyms\":{}}");

	add("subsidiarity", "{\"term\":\"subsidiarity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla\u0027 Composition: {{suffix|subsidiary|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The principle that government power ought to reside at the lowest feasible level (i.e. at the local or regional level, instead of the national or supranational level, unless the latter presents clear advantages\", \"priority\":1}]}, \"synonyms\":{}}");

	add("subsidy", "{\"term\":\"subsidy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|subsidie}}, from Old french (842-ca. 1400) {{m|fro|subside}}, from Latin {{m|la|subsidium}}, from \u0027subsidere\u0027 (to settle down, stay, remain)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Financial support or assistance, such as a grant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/united-states/21583274-new-wave-press-barons-should-not-allow-newspapers-become-niche-products-keeping Keeping the mighty passage\u003dBritish journalists shun complete respectability, feeling a duty to be ready to savage the mighty, or rummage through their bins. Elsewhere in Europe, government contracts and \u0027\u0027subsidies\u0027\u0027 ensure that press barons will only defy the mighty so far\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Money granted by parliament to the British Crown\", \"priority\":3}]}, \"synonyms\":{}}");

	add("subsign", "{\"term\":\"subsign\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|sign|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lower-level sign\", \"priority\":1}]}, \"synonyms\":{}}");

	add("subsilicate", "{\"term\":\"subsilicate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|silicate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A basic silicate\", \"priority\":1}]}, \"synonyms\":{}}");

	add("subsoil", "{\"term\":\"subsoil\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|soil|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The layer of earth that is below the topsoil\", \"priority\":1}]}, \"synonyms\":{}}");

	add("subsoiling", "{\"term\":\"subsoiling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"ploughing to the depth of the subsoil\", \"priority\":1}]}, \"synonyms\":{}}");

	add("subspecialty", "{\"term\":\"subspecialty\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|specialty|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A specialty within a specialty\", \"priority\":1}]}, \"synonyms\":{}}");

	add("subspecies", "{\"term\":\"subspecies\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|species|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rank in the classification of organisms, below specie\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A taxon at that ran\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In zoology and bacteriology, \u0027\u0027subspecies\u0027\u0027 is the only rank below that of species which is formally accepted by the relevant nomenclatural Code\", \"priority\":3}]}, \"synonyms\":{}}");

	add("substance", "{\"term\":\"substance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027substance\u0027 from Latin \u0027substantia\u0027 (substance, essence) from \u0027substāns\u0027 present active participle of \u0027substō\u0027 (exist; literally, stand under) from \u0027sub\u0027 + \u0027stō\u0027 (stand)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Physical matter; material\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1699\u0027\u0027, \u0027[http://essays.quotidiana.org/temple/heads_for_conversation/ Heads designed for an essay on conversations\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Study gives strength to the mind; conversation, grace: the first apt to give stiffness, the other suppleness: one gives \u0027\u0027substance\u0027\u0027 and form to the statue, the other polishes it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21581981-what-pollution-some-opportunity-others-welcome-plastisphere Welcome to the passage\u003dPlastics are energy-rich \u0027\u0027substances\u0027\u0027, which is why many of them burn so readily. Any organism that could unlock and use that energy would do well in the Anthropocene. Terrestrial bacteria and fungi which can manage this trick are already familiar to experts in the field\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The essential part of anything; the most vital part\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1631-1700\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Heroic virtue did his actions guide, / And he the \u0027\u0027substance\u0027\u0027, not the appearance, chose\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Bishop Burne\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"This edition is the same in \u0027\u0027substance\u0027\u0027 with the Latin\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1729-1797\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"It is insolent in words, in manner; but in \u0027\u0027substance\u0027\u0027 it is not only insulting, but alarming\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Substantiality; solidity; firmness\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Material possessions; estate; property; resources\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Bible, xv. 1\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"And there wasted his \u0027\u0027substance\u0027\u0027 with riotous living\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Thy \u0027\u0027substance\u0027\u0027, valued at the highest rate, / Cannot amount unto a hundred marks\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1667–1745\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"We are destroying many thousand lives, and exhausting our \u0027\u0027substance\u0027\u0027, but not for our own interest\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A form of matter that has constant chemical composition and characteristic properties\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Drugs\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Hypostasis\", \"priority\":22}]}, \"synonyms\":{}}");

	add("substantialness", "{\"term\":\"substantialness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being substantial\", \"priority\":1}]}, \"synonyms\":{}}");

	add("substituent", "{\"term\":\"substituent\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"any atom, group, or radical substituted for another, or entering a molecule in place of some other part which is remove\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"pro-form\", \"priority\":2}]}, \"synonyms\":{}}");

	add("substitutivity", "{\"term\":\"substitutivity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A logical relationship in which two terms can be mutually substituted without affecting the truth value of any propositions in which the terms occur, thereby establishing that the terms are identical\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1943\u0027\u0027, w:Willard Van Orman Willard V. Quine, \u0026quot;Notes on Existence and Necessity,\u0026quot; \u0027The Journal of Philosophy\u0027, vol. 40, no. 5, p. 113\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One of the fundamental principles governing identity is that of \u0027\u0027\u0027substitutivity\u0027\u0027\u0027—or, as it might well be called, that of indiscernibility of identicals. It provides that, \u0027given a true statement of identity, one of its two terms may be substituted for the other in any true statement and the result will be true\", \"priority\":3}]}, \"synonyms\":{}}");

	add("substrate", "{\"term\":\"substrate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Anglicization of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"What an enzyme acts upon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A surface on which an organism grows, or to which an organism or an item is attached\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The rock surface of a rockpool is the \u0027\u0027substrate\u0027\u0027 for a sessile organism such as a limpet\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Edward A. Wasserman, Thomas R. Zentall, \u0027Comparative Cognition: Experimental Explorations of Animal Intelligence\u0027 (ISBN 0195167651), page 520\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Detach/subtract [tasks involve] Severing a fixed attachment between environmental objects (or the \u0027\u0027substrate\u0027\u0027) or removing object(s) from another unattached object, so the latter is a more useful tool\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Mike Hansell, \u0027Bird Nests and Construction Behaviour\u0027 (ISBN 1139429086), page 90\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"This definition [of \u0026quot;tool\u0026quot;] is not simple, but contains several elements. The tool must not be part of the animal\u0027s body (a beak is not a tool); the user must manipulate the tool in some way for it to realise its function; and, finally, a tool cannot be attached to the \u0027\u0027substrate\u0027\u0027. This is a fairly clear definition, but does seem to produce some rather arbitrary distinctions (Hansell 1987b). The spider \u0027Dinopis\u0027, for example, makes a small web which it holds in its legs, thrusting it down on passing ants. This is a tool, but all other webs, however complex, are not since they are anchored to the \u0027\u0027substrate\u0027\u0027. The woodpecker finch [...] that uses a fine stick held in the beak to extract insect prey from wood, is a tool user, but a shrike [...] that impales an insect on a thorn still attached to the bush is not\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An underlying layer; a substratum\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A language that is replaced in a population by another language and that influences the language imposed on its speakers\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A metal which is plated with another metal which has different physical properties\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A surface to which a substance adheres\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The substance lining the bottom edge of an enclosure\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027substrate\u0027\u0027 of an aquarium can affect the water\u0027s acidity\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Stream \u0027\u0027substrate\u0027\u0027 affects fish longevity\", \"priority\":14}]}, \"synonyms\":{}}");

	add("substratism", "{\"term\":\"substratism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|substrate|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The theory that creoles take their structure from their substrate languages\", \"priority\":1}]}, \"synonyms\":{}}");

	add("substratist", "{\"term\":\"substratist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|substrate|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who believes that creoles take their structure from their substrate languages\", \"priority\":1}]}, \"synonyms\":{}}");

	add("substring", "{\"term\":\"substring\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|sub|string|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A (possibly zero-length) string of characters that is contained in another string\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;Hell\u0026quot; is a substring of \u0026quot;Hello\u0026quot\", \"priority\":2}]}, \"synonyms\":{}}");

	add("substructure", "{\"term\":\"substructure\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|structure|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The supporting part of a structure (either physical or organizational; the foundation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The earth or gravel that railway sleepers are embedded in\", \"priority\":2}]}, \"synonyms\":{}}");

	add("subsumer", "{\"term\":\"subsumer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|subsume|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, subsumes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("subsurface", "{\"term\":\"subsurface\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|surface|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that is below the layer that is on the surface\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Before we could lay the flooring we had to lay a \u0027\u0027subsurface\u0027\u0027 under it to keep it flat and supoort it\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A surface which is a submanifold of another surface\", \"priority\":3}]}, \"synonyms\":{}}");

	add("subsymbol", "{\"term\":\"subsymbol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|symbol|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A subdivision of a symbol\", \"priority\":1}]}, \"synonyms\":{}}");

	add("subterfuge", "{\"term\":\"subterfuge\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027subterfuge\u0027 from \u0027subterfugium\u0027 from Latin \u0027subterfugio\u0027 (i flee secretly) from \u0027subter\u0027 (under) and \u0027fugio\u0027 (i flee)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An indirect or deceptive device or stratagem; a blind. Refers especially to war and politics\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Overt \u0027\u0027subterfuge\u0027\u0027 in a region nearly caused a minor accident\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"How’s the spy hunt going? Uncovered any \u0027\u0027subterfuge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dBut was it responsible governance to pass the Longitude Act without other efforts to protect British seamen? Or might it have been \u0027\u0027subterfuge\u0027\u0027—a disingenuous attempt to shift attention away from the realities of their life at sea\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Deception; misrepresentation of the true nature of an activity\", \"priority\":5}]}, \"synonyms\":{}}");

	add("subtext", "{\"term\":\"subtext\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|text|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The implicit meaning of a text, often a literary one, or a speech or dialogue\", \"priority\":1}]}, \"synonyms\":{}}");

	add("subtheme", "{\"term\":\"subtheme\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|theme|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A specific theme within a larger them\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"grouped by \u0027\u0027subtheme\u0027\u0027, they are easier to skim than the 12 sites that fill the entire first page of Google’s search results\", \"priority\":2}]}, \"synonyms\":{}}");

	add("subtitle", "{\"term\":\"subtitle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|title|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A heading below or after a title\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Textual versions of the dialog in films, usually displayed at the bottom of the screen\", \"priority\":2}]}, \"synonyms\":{}}");

	add("subtitler", "{\"term\":\"subtitler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|subtitle|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who translates subtitles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A software package that assists in creating subtitles for movies, documentaries, etc\", \"priority\":2}]}, \"synonyms\":{}}");

	add("subtlety", "{\"term\":\"subtlety\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027sutilté\u0027 from Latin \u0027subtīlitās\u0027 from \u0027subtīlis\u0027 (subtle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or fact of being subtle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"With all his usual \u0027\u0027subtlety\u0027\u0027, he quietly fixed the problem before anyone else noticed it\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An instance of being subtle, a subtle thing, especially a subtle argument or distinction\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027subtleties\u0027\u0027 of this overture are often overlooked\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An ornate medieval illusion dish or table decoration, especially when made from one thing but crafted to look like another\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"At the king\u0027s coronation feast, several \u0027\u0027subtleties\u0027\u0027 were served between main courses\", \"priority\":6}]}, \"synonyms\":{}}");

	add("subtopia", "{\"term\":\"subtopia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|suburb|utopia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Sprawling suburbs, collectively\", \"priority\":1}]}, \"synonyms\":{}}");

	add("subtotal", "{\"term\":\"subtotal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|total|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The total for a part of a list of numbers being summed\", \"priority\":1}]}, \"synonyms\":{}}");

	add("subtraction", "{\"term\":\"subtraction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"uncountable\u0027) The process of subtracting a number from another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"countable\u0027) A calculation involving subtracting\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The teacher has set us ten subtractions to do by tomorrow\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The removal of something\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027subtraction\u0027\u0027 of the wealth from the economy will result in recession\", \"priority\":5}]}, \"synonyms\":{}}");

	add("subtrahend", "{\"term\":\"subtrahend\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"1670s, from Latin \u0027subtrahendus\u0027 \u0027numerus\u0027 (number to be subtracted) form of \u0027subtrahō\u0027 (i pull out from under, i subtract) (English \u0027subtract\u0027 .\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;Surface analysis is {{suffix|subtract|end|t2\u003dpatient (recipient) of action|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A number or quantity to be subtracted from another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In the subtraction 10 \u0026amp;minus; 4, 4 is the subtrahend\", \"priority\":2}]}, \"synonyms\":{}}");

	add("subtweet", "{\"term\":\"subtweet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|sub|tweet|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tweet (message posted to the microblogging service Twitter) that refers to another user without tagging their name in the message, so that the user being talked about is not automatically notified\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Daleen Berry, ‎Geoffrey Fuller, \u0027The Savage Murder of Skylar Neese\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But it was also a \u0027\u0027subtweet\u0027\u0027, addressed to one person but meant for someone else entirely\", \"priority\":3}]}, \"synonyms\":{}}");

	add("suburb", "{\"term\":\"suburb\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027suburbe\u0027 \u0027\u0027 from Latin \u0027suburbium\u0027 from \u0027\u0027 + \u0027urbs\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A residential area located on the outskirts of a city or large town that usually includes businesses that cater to its residents; such as schools, grocery stores, shopping centers, restaurants, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Halla\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"London] could hardly have contained less than thirty or forty thousand souls within its walls; and the \u0027\u0027suburbs\u0027\u0027 were very populous\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The outer part; the environment\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Jeremy Taylo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027suburbs\u0027\u0027 of sorro\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027suburb\u0027\u0027 of their straw-built citade\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Any subdivision of a conurbation, not necessarily on the periphery\", \"priority\":9}]}, \"synonyms\":{}}");

